export const getSvg = (type) => {

    switch (type) {
        case "Financial overview":
            return Financial_overview;
        case "Outstanding A/R":
            return Outstanding_A_R;
        case "Matter status":
            return matter_status;
        case "Overdrawn client balances":
            return Overdrawn_client_balances;
        case "with status Closed":
            return close_status;
        case "Quick links":
            return Quick_links;
        case "Monthly review checklist":
            return Monthly_review_checklist;
        case "Overdue task":
            return Overdue_task;
        case "moreBtn":
            return moreBtn;
        case "KPI":
            return KPI;
        case "Create support calculations":
            return Create_support_calculations;
        case "Generate reports":
                return generate_report;

        default: return ""

    }


}